import React from 'react';
import {Container, Button, Card} from '@mui/material';

export default function Dashboard() {
    return (
        <Container maxWidth="sm">
        <Card variant="outlined">
            <Button variant="contained">Hello World</Button>
        </Card>
        </ Container>
    )
}
